How to take clientside Javascript arrays and POST through a Node.js API into a MongoDB database?<p>I have a single webpage that initially has two form inputs, one for a list of names and another for the title of a game. I've written some javascript/jquery that takes the X names and creates X more form inputs meant for each person's specific score. The javascript then creates the following variables upon the clicking of the names/scores form's submit button:</p>

<pre><code>gameTitle = Monopoly
users = [Bob, Bill, Jim, Janet]
scores = [100, 110, 90, 80]
positions = [2, 1, 3, 4]
</code></pre>

<p>I then have a MongoDB schema set up as such:</p>

<pre><code>const SessionSchema = new mongoose.Schema({
gameTitle: String,
users: [],
scores: [],
positions: []
});
</code></pre>

<p>And a Node.js handler as such:</p>

<pre><code>const express = require('express');
const router = express.Router();
const bodyParser = require('body-parser');
const timestamps = require('mongoose-timestamp');

router.use(bodyParser.urlencoded({ extended: true }));
router.use(bodyParser.json());

const Session = require('./Session');

//Post a session to the database
router.post('/', function(req, res) {
    Session.create({
        gameTitle : req.body.gameTitle,
        users : req.body.user,
        scores : req.body.score,
        positions : req.body.position
    },
    function (err, session) {
        if (err) return res.status(500).send("There was a problem adding the information to the database");
        res.status(200).send(session);
    });
});
</code></pre>

<p>Using Postman I can see that posting works when I use this format:</p>

<p><a href="https://i.stack.imgur.com/nTabH.png" rel="nofollow noreferrer">Postman POST</a></p>

<p><a href="https://i.stack.imgur.com/uzl6c.png" rel="nofollow noreferrer">Postman GET</a></p>

<p>How do I take the created javascript variables and, also upon the clicking of the names/scores form's submit button, POST them through the API and into the MongoDB database?</p>

<p>Apologies if I have missed any important information/code - I haven't fully wrapped my head around how the backend stuff works.</p>

